INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b642662e966801664993d46c0032',NULL,'2c92b642662e9668016653a0b5e60039,2c92b642662e9668016653a08a810038,2c92b642662e9668016653a020440037,,,2c92b642662e9668016653a4394a003b,,,,,,,,,,,,2c92b642662e9668016653a205b2003a','2018-10-06 13:31:57','/images/20181006/1538832628063.jpg','推荐方案',230,NULL,NULL,'2c92b642662e9668016649101b060020'),('2c92b64266ccf4b30166e90691070032','<h4>退款</h4>\r\n套餐内按照使用次数计算服务费，剩余的金额退回；\r\n提交退款申请，将会在3~7个工作日退回原支付账户；\r\n平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n<p>\r\n服务内容：\r\n<br>1.表达关心：向探望对象传达客户的关心、惦念与对疾病康复的祝愿。\r\n<br>2.基础护理：更衣、翻身拍背、辅助进食服药等生活护理，代替家人亲友给予更专业的陪伴。\r\n<br>3.病情监护：从专业的角度更密切关注病情的变化，及时与主管医生沟通，向家属及委托人汇报。\r\n<br>4.心理疏导：悉心陪伴、耐心疏导，帮助客户缓解疾病焦虑，增强康复信心。\r\n<br>5.生活指导：\r\n根据患者病情与生活习惯，给出饮食、锻炼、康复建议\r\n</p>\r\n',NULL,'2018-11-06 12:36:54','/images/20181106/1541508523255.jpg','住院探视护理',300,NULL,'\r\n1.住院探视护理不提供住院护士职责范围内的专业护理；\r\n2.本服务仅针对患者本人服务。\r\n3.本次服务时长为90分钟，超出时长按照20分钟一个单位加收40元。\r\n4.套餐内次数，有效期为一年。\r\n5.本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n<p>平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）</p>\r\n\r\n','2c92b642662e966801664912026f0022'),('2c92b64266ccf4b30166e9072dbf0033','<h4>退款</h4>\r\n<br>套餐内按照使用次数计算服务费，剩余的金额退回；\r\n<br>提交退款申请，将会在3~7个工作日退回原支付账户；\r\n<br>平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n\r\n\r\n<h4>注意事项</h4>\r\n\r\n<br>1.	注意保持皮肤清洁及干燥,促进组织修复；\r\n<br>2.	避免提重物及剧烈的运动，穿衣要宽松,避免压迫造口；\r\n<br>3.	出现以下情况时，请及时到医院处理：造囗坏死、严重的造口回缩、严重的造口狭窄、造口脱垂、严重的造口撕裂等；\r\n<br>4.	结肠造口建议在饭前或饮食后2小时进行造口袋的更换,或者根据患者的排便习惯安排换袋时机,请根据自己的换袋时间在平台上下单预约；\r\n<br>5.	受限于客观条件，具有攻击性、易产生过激反应的患者不在服务范围以内；\r\n<br>6.	护理项目需要家属陪同，如家属无法陪同请谨慎使用此护理服务；\r\n<p>\r\n<br>护理工具：\r\n<br>造口护理医疗包（如需使用人工肛袋需自备）\r\n<br>种类                    规格/数量\r\n<br>一次性换药包             通用1\r\n<br>无菌手套                 中号1 \r\n<br>医用纱布块              通用若干\r\n<br>无菌棉签                通用若干\r\n<br>医用胶布                通用若干\r\n<br>注：耗材具体费用根据医疗机构